    const [article]=useContext(contextData);

    return (
        <div className='stkhead'>
            <h1 className='headsiren'><h2>The</h2>Siren</h1>
            <h2 className='titlelink'>
            <NavLink className="nlink" style={({isActive})=>{return ({"color":isActive?"gray":""})}} to='./home'> Home</NavLink>
