            <NavLink className="nlink" style={({isActive})=>{return ({"color":isActive?"gray":""})}} to='./technology' > Technology</NavLink>
            <NavLink className="nlink" style={({isActive})=>{return ({"color":isActive?"gray":""})}} to='./hollywood' > Hollywood</NavLink>
            <NavLink className="nlink" style={({isActive})=>{return ({"color":isActive?"gray":""})}} to='./fitness' > Fitness</NavLink>
            <NavLink className="nlink" style={({isActive})=>{return ({"color":isActive?"gray":""})}} to='./food' > Food</NavLink>
            </h2><hr className='hrstl'/>

        </div>
    )
}
